import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
import axios from 'axios';

function ComName({ onNameChange }) {
  const handleNameChange = (e) => {
    onNameChange(e.target.value);
  };

  return (
    <div>
      <h1>Create a Community</h1>
      <p>Build and grow a community about something you care about. We'll help you set things up.</p>
      <input className="w90" type="text" placeholder="Name" onChange={handleNameChange} />
      <p>Name cannot be changed later</p>
    </div>
  );
}

function ComType({ onTypeChange }) {
  const handleTypeChange = (e) => {
    onTypeChange(e.target.value);
  };

  return (
    <div className="type">
      <h2>TYPE</h2>
      <ul className="typeslist">
        <li>
          <input type="radio" id="public" name="communityType" value="public" defaultChecked onChange={handleTypeChange} />
          <label className="ml10" htmlFor="public">Public</label>
        </li>
        <li>
          <input type="radio" id="restricted" name="communityType" value="restricted" onChange={handleTypeChange} />
          <label className="ml10" htmlFor="restricted">Restricted</label>
        </li>
        <li>
          <input type="radio" id="private" name="communityType" value="private" onChange={handleTypeChange} />
          <label className="ml10" htmlFor="private">Private</label>
        </li>
      </ul>
    </div>
  );
}

function CreateCommunity() {
  const [communityName, setCommunityName] = useState('');
  const [communityType, setCommunityType] = useState('public');
  const [isAdultContent, setIsAdultContent] = useState(false);

  const handleCreate = () => {
    if (!communityName.trim()) {
      alert('Please provide a community name.');
      return;
    }

    console.log('Creating community...', communityName, communityType, isAdultContent);
    // Here you can submit the community data to the server using Axios
    // For example:
     axios.post('/api/create-community', { name: communityName, type: communityType, adultContent: isAdultContent })
      .then(response => {
        console.log('Community created successfully:', response.data);
       })
      .catch(error => {
        console.error('Error creating community:', error);
   });
  };

  return (
    <div>
      <ComName onNameChange={setCommunityName} />
      <ComType onTypeChange={setCommunityType} />
      <div className="adult">
        <div className="adult-header">Adult Content</div>
        <div className="adultCheckbox">
          <input
            type="checkbox"
            checked={isAdultContent}
            onChange={(e) => setIsAdultContent(e.target.checked)}
          />
          <label>18+ year old community</label>
        </div>
      </div>
      <div className="cancelcreate">
        <button className="cancel">Cancel</button>
        <button className="create" onClick={handleCreate}>Create</button>
      </div>
    </div>
  );
}

function CreateC() {
  return (
    <div>
      <CreateCommunity />
    </div>
  );
}

export default CreateC;
